import './App.css';
import Head from './Head';
import Home from './Home';
import MovingImage from './photoAlshifa';
import Projecttext from './Projecttext';
import Text from './Text';
import TextAlshifa from './TextAlshifa';
import Texttow from './Texttow';

function App() {
  return (<>
<div class=" bg-gradient-to-r from-slate-950 from-10% via-slate-820 via-30% to-zinc-600 to-90% ... h-2vh">



<Head/>
<div className='h-3'><img className='as' src='019 Malibu Beach.png'/> </div>
<div className=' flex h-1/2 justify-center'>
 <div className='w-96 pl-6 pt-3 '><Text/></div>

<div className='w-96 pl-6 mt-16 '><Texttow/></div>
</div>
<Projecttext/>
<div className=''>
<TextAlshifa/>
<MovingImage/>
</div>
</div>

</>
  );
}

export default App;
